helloworld.sol.content:
// SPDX-License-Identifier: GL-3.0
pragma solidity >= 0.7.0 <0.9.0;

interface IHelloWorld{
    function helloWorld() external view returns(string memory);
}

contract HelloWorld {
    string private text;
    constructor() {
        text = "Hello World";
    }

    function helloWorld() public view returns (string memory){
        return text;
    }

    function setText(string calldata newText) public {
        text = newText;
    }
}
contract Greeter{
    function getGreeting(address contractAddress) public view returns (string memory){
        IHelloWorld ihelloworld = IHelloWorld(contractAddress);
        return ihelloworld.helloWorld();
    }

}

